[[Designer drug]]s are structural or functional analogues of [[controlled substance]]s that are designed to mimic the pharmacological effects of the parent drug while avoiding detection or classification as illegal. Some designer drugs (research chemicals) are structural analogues of psychoactive [[tryptamine]]s or [[phenethylamine]]s but there are many other chemically unrelated psychoactive substances that can be considered part of the designer drug group.<ref name=EMCDDA2013>{{cite web | url=http://www.emcdda.europa.eu/publications/implementation-reports/2013 | title=EMCDDA–Europol 2013 Annual Report on the information exchange, risk assessment and control of new&nbsp;psychoactive substances (implementation of Council Decision 2005/387/JHA) | publisher=[[EMCDDA]] | date=July 2014 | accessdate=8 August 2014 }}</ref><ref name=EMCDDA-NPD2012>{{cite web | url=http://www.emcdda.europa.eu/publications/implementation-reports/2012 | title=EMCDDA–Europol 2012 Annual Report on the implementation of Council Decision 2005/387/JHA (New drugs in Europe, 2012) | publisher=[[EMCDDA]] | date=May 2013 | accessdate=8 August 2014 }}</ref><ref name=EMCDDA-NPD2011>{{cite web | url=http://www.emcdda.europa.eu/publications/implementation-reports/2011 | title=EMCDDA–Europol 2011 Annual Report on the (information exchange, risk assessment and control of new&nbsp;psychoactive substances) implementation of Council Decision 2005/387/JHA | publisher=[[EMCDDA]] | date=April 2012 | accessdate=8 August 2014 }}</ref><ref name=EMCDDA-NPD2010>{{cite web | url=http://www.emcdda.europa.eu/publications/implementation-reports/2010 | title=EMCDDA–Europol 2010 Annual Report on the implementation of Council Decision 2005/387/JHA | publisher=[[EMCDDA]] | date=May 2011| accessdate=8 August 2014 }}</ref> Designer drugs also include analogues of controlled [[anabolic steroid]]s. The pharmaceutical activities of these compounds might not be predictable based strictly upon [[structure activity relationship|structural examination]]. Many of the substances have common effects while structurally different or different effects while structurally similar due to [[Quantitative structure-activity relationship#SAR and the SAR paradox|SAR paradox]]. As a result of no real official naming for some of these compounds, as well as [[slang|regional naming]], this can all lead to potentially hazardous mix ups for users.<ref>{{cite journal | vauthors = Shimizu E, Watanabe H, Kojima T, Hagiwara H, Fujisaki M, Miyatake R, Hashimoto K, Iyo M | title = Combined intoxication with methylone and 5-MeO-MIPT | journal = Progress in Neuro-Psychopharmacology & Biological Psychiatry | volume = 31 | issue = 1 | pages = 288–91 | date = Jan 2007 | pmid = 16876302 | doi = 10.1016/j.pnpbp.2006.06.012 }}</ref> The following list is not exhaustive.
== Psychedelics ==
{{see also|List of psychedelic drugs}} A [[Psychedelic drug|psychedelic substance]] is a psychoactive drug whose primary action is to alter cognition and perception. Psychedelics tend to affect and explore the mind in ways that result in the experience being qualitatively different from those of ordinary consciousness. The psychedelic experience is often compared to non-ordinary forms of consciousness such as trance, meditation, yoga, religious ecstasy, dreaming and even near-death experiences.
