== Dissociatives == [[Dissociative]]s are a class of hallucinogens which distort perceptions of sight and sound and produce feelings of detachment - dissociation - from the environment and self. This is done through reducing or blocking signals to the conscious mind from other parts of the brain. Although many kinds of drugs are capable of such action, dissociatives are unique in that they do so in such a way that they produce hallucinogenic effects, which may include sensory deprivation, dissociation, hallucinations, and dream-like states or trances. Some, which are nonselective in action and affect the dopamine and/or opioid systems, may be capable of inducing euphoria. Many dissociatives have general depressant effects and can produce sedation, respiratory depression, analgesia, anesthesia, and ataxia, as well as cognitive and memory impairment and amnesia.
