== Stimulants == [[Stimulant]]s produce a variety of different kinds of effects by enhancing the activity of the central and peripheral nervous systems. Common effects, which vary depending on the substance and dosage in question, may include enhanced alertness, awareness, wakefulness, endurance, productivity, and motivation, increased arousal, locomotion, heart rate, and blood pressure, and the perception of a diminished requirement for food and sleep.
=== Amphetamines === [[Substituted amphetamine|Amphetamines]] are a chemical class of stimulants, entactogens, hallucinogens, and other drugs. They feature a phenethylamine core with a methyl group attached to the alpha carbon resulting in amphetamine, along with additional substitutions. {{columns-list|colwidth=25em| * [[2-Fluoroamphetamine|2-FA]], 2-Fluoroamphetamine * [[2-Fluoromethamphetamine|2-FMA]], 2-Fluoromethamphetamine * [[Ortetamine|2-MA]], 2-Methylamphetamine, Ortetamine * [[3-Fluoroamphetamine|3-FA]], 3-Fluoroamphetamine * [[3-Fluoromethamphetamine|3-FMA]], 3-Fluoromethamphetamine * [[3-Methylamphetamine]], 3-MA, meta-Methamphetamine * [[Beta-Phenylmethamphetamine|β-Phenylmethamphetamine]] * [[N,alpha-Diethylphenylethylamine]], EAPB }}
