== Sedatives ==
[[Sedative]]s are substances that induces sedation by reducing irritability or excitement. At higher doses they may result in slurred speech, staggering gait, poor judgment, and slow, uncertain reflexes. Doses of sedatives such as benzodiazepines, when used as a hypnotic to induce sleep, tend to be higher than amounts used to relieve anxiety, whereas only low doses are needed to provide a peaceful effect. Sedatives can be misused to produce an overly-calming effect. In the event of an overdose or if combined with another sedative, many of these drugs can cause unconsciousness and even death.
