== Androgens == Androgenic [[anabolic steroid]]s have approved medical uses as well as used illicitly as [[performance-enhancing drug]]s to build muscle mass and strength. Anabolic steroids that have been designed to evade detection in [[doping in sport#drug testing|sport doping tests]] are known as "designer steroids".<ref name="pmid20020364">{{cite journal | vauthors = Kazlauskas R | title = Designer steroids | journal = Handb Exp Pharmacol | volume = 195 | issue = 195 | pages = 155–85 | year = 2010 | pmid = 20020364 | doi = 10.1007/978-3-540-79088-4_7 }}</ref><ref name="pmid24702116">{{cite journal | vauthors = Abushareeda W, Fragkaki A, Vonaparti A, Angelis Y, Tsivou M, Saad K, Kraiem S, Lyris E, Alsayrafi M, Georgakopoulos C | title = Advances in the detection of designer steroids in anti-doping | journal = Bioanalysis | volume = 6 | issue = 6 | pages = 881–96 | year = 2014 | pmid = 24702116 | doi = 10.4155/bio.14.9 }}</ref>
