=== SARMs === [[Selective androgen receptor modulator]]s (SARMs) are a novel class of [[androgen receptor]] ligands. They are intended to maintain the desirable muscle building effects of anabolic steroids while reducing undesirable androgenic actions (e.g., increased risk of [[prostate cancer]]). SARMs that are more selective in their action potentially could be used for a wider range clinical indications than the relatively limited legitimate uses that anabolic steroids are currently approved for.<ref name="pmid23231475">{{cite journal | vauthors = Zhang X, Sui Z | title = Deciphering the selective androgen receptor modulators paradigm | journal = Expert Opin Drug Discov | volume = 8 | issue = 2 | pages = 191–218 | year = 2013 | pmid = 23231475 | doi = 10.1517/17460441.2013.741582 }}</ref>
